import React, { useState } from 'react';

const HousingAdd = () => {
  const [formData, setFormData] = useState({
    name: '',
    houseNumber: '',
    housePlan: '',
    // ฟิลด์อื่น ๆ ที่ต้องการเพิ่ม
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // ทำสิ่งที่คุณต้องการกับข้อมูลที่ได้จากฟอร์ม เช่นส่งไปยัง API เพื่อเพิ่มข้อมูลบ้านใหม่
    console.log(formData);
    // เคลียร์ข้อมูลในฟอร์มหลังจากส่งข้อมูล
    setFormData({
      name: '',
      houseNumber: '',
      housePlan: '',
      // ฟิลด์อื่น ๆ ที่ต้องการเพิ่ม
    });
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Name:
        <input type="text" name="name" value={formData.name} onChange={handleChange} />
      </label>
      <br />
      <label>
        House Number:
        <input type="text" name="houseNumber" value={formData.houseNumber} onChange={handleChange} />
      </label>
      <br />
      <label>
        House Plan:
        <input type="text" name="housePlan" value={formData.housePlan} onChange={handleChange} />
      </label>
      <br />
      {/* ฟิลด์อื่น ๆ ที่ต้องการเพิ่ม */}
      <button type="submit">Add House</button>
    </form>
  );
};

export default HousingAdd;
